const paths = svg.split('\n')


const points = paths.map(path=>{
    const parts = path.split(' ')
    if (!parts.length)
        return null

    const x = parseFloat(parts[1].replace('d="M', ''))
    const y = parseFloat(parts[2].split('.').splice(0, 2).join('.'))

    const regularExpression = /#(?:[0-9a-fA-F]{3}){1,2}/g
    const fill = path.match(regularExpression);

    return {x, y, fill}
})

console.log(points)
